Alpine.data("etapasObra",()=>({tab:1,closeModal(a){a().inputsEtapa.nome=null,a().inputsEtapa.porc_etapa=0,a().inputsEtapa.porc_geral=0,a().inputsEtapa.concluida=!1,a().etapaIdEdit=!1,a().modal=!1},setEdit(a,t){t().inputsEtapa.nome=a.nome,t().inputsEtapa.porc_etapa=a.porc_etapa,t().inputsEtapa.porc_geral=a.porc_geral,t().inputsEtapa.concluida=a.concluida,t().etapaIdEdit=a.id,t().modal=!0},excluirEtapa(a,t){this.$store.dialog.show("Excluir etapa","Realmente deseja excluir a etapa?",{cancel:{},confirm:{text:"Sim, excluir!",action:()=>t().delEtapa(a)}})}}));
